import React from "react";

const Events = () => {
  return (
    <section className="event">
      <ul class="nav nav-tabs justify-">
        <li class="nav-item">
          <a class="nav-link active" href="#">
            الفعاليات الحالية
          </a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">
            الفعاليات السابقة
          </a>
        </li>
        
      </ul>
    </section>
  );
};

export default Events;
